case class processTimePer(time:String, avg:Double,per50:Double,per95:Double, per99:Double)
//case class processTimePer(time:String,per50:Double,per95:Double, per99:Double)

def calPerByTens(proList: Array[(String, Long)])={
    var lastTime= proList.head._1
    var td=TDigest.createDigest(100d)
    var ipProTimeList = mutable.MutableList[processTimePer]()
    var count = 0d
    var sum = 0d

    proList.map{s=>
        if(s._1==lastTime){
            td.add(s._2.toLong)
            count += 1d
            sum += s._2.toLong
        }else{
            //ipProTimeList += processTimePer(lastTime,td.quantile(0.5)/1000,td.quantile(0.95)/1000,td.quantile(0.99)/1000)
            ipProTimeList += processTimePer(lastTime,sum/count/1000,td.quantile(0.5)/1000,td.quantile(0.95)/1000,td.quantile(0.99)/1000)
            sum = s._2.toLong
            count = 1d
            td=TDigest.createDigest(100d)
            td.add(s._2.toLong)
        }
        lastTime = s._1
    }
    //ipProTimeList += processTimePer(lastTime,td.quantile(0.5)/1000,td.quantile(0.95)/1000,td.quantile(0.99)/1000)
    ipProTimeList += processTimePer(lastTime,sum/count/1000,td.quantile(0.5)/1000,td.quantile(0.9)/1000,td.quantile(0.99)/1000)
    ipProTimeList.toDF()
}

